import React from "react";
import TodoListItem from "./TodoListItem";

const TodoList = ({todos}) => {
    const elements = todos.map((item) => {
        return <li key={item.id}><TodoListItem {...item}/></li>;
    });
    return (<ul>
        {elements}
    </ul>);
};
export default TodoList;
